import React from 'react';
import Graph from './components/Home';
import './App.css';
import Nav from './components/Nav';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App"> 
    <Nav />
      <Switch>
        <Route path='/Home' component='./components/Home'  />
      </Switch>
      <Switch>
        <Route path='/Tracker' components={Tracker} />
      </Switch>


    </div>
    </Router>
  );
}

export default App;
